To find the median of 27 positive integers whose product is \(3^7\), we need to consider the properties of medians and the constraints given by the product. The median of a list of 27 numbers is the 14th number when the numbers are arranged in ascending order.

Given that the product of the 27 numbers is \(3^7\), and since \(3^7 = 2187\), each number in the list must be a power of 3 or a product of powers of 3. The simplest way to distribute the factors of \(3^7\) among 27 numbers is to have most of the numbers be 1, and the rest be powers of 3 such that their product still equals \(3^7\).

Let's start by assuming that we have \(k\) numbers that are 3 and \(27-k\) numbers that are 1. The product of these numbers is \(3^k \cdot 1^{27-k} = 3^k\). We need \(3^k = 3^7\), so \(k = 7\). This means we have 7 numbers that are 3 and 20 numbers that are 1. When we arrange these numbers in ascending order, we get:

\[1, 1, 1, 1, 1, 1, 1, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 1, 1, 1, 1, 1, 1, 3, 1, 1, 1\]

The 14th number in this ordered list is 3. Therefore, the median of these 27 numbers is:

\[\boxed{1}\]

