To determine the cost of one svinčik in cents, we need to analyze the given information and set up a system of linear equations.

Let's define:
- \( x \) as the cost of one svinčik in dollars.
- \( y \) as the cost of one radirka in dollars.

From the problem, we have the following two equations:
1. For three svinčniki and one radirka: \( 3x + y = 1.24 \)
2. For two svinčniki and one radirka: \( 2x + y = 1.82 \)

We can solve this system of equations using the method of elimination. First, we subtract the second equation from the first equation to eliminate \( y \):

\[
(3x + y) - (2x + y) = 1.24 - 1.82
\]

Simplifying both sides, we get:

\[
3x + y - 2x - y = 1.24 - 1.82
\]

\[
x = -0.58
\]

