original_question:
Pravokotnik $ABCD$ ima središče $O$ in $AB/AD=k$. Točka je naključno izbrana iz notranjosti pravokotnika $ABCD$. Kakšna je verjetnost, da je bližje točki $O$ kot kateremu koli od štirih oglišč?  [asy]
size(200);
draw((-250,100)--(250,100)--(250,-100)--(-250,-100)--cycle);
dot((0,0));
label("$O$",(0,0),N);
label("$A$",(-250,100),NW); label("$B$",(250,100),NE); label("$C$",(250,-100),SE); label("$D$",(-250,-100),SW);[/asy]

